class View {

      view={
          stage:function () {


              return ("<form>  <div id='search_movies'>" +
                  "<input type='search' id='search' placeholder='Search for movies'>" +
                  "<img src={search_glass} alt='search'></div></form>");

          }
      }






}

export default View;
